create table t_task_instance
(
    id                    BIGINT(19) auto_increment
        primary key,
    template_name         VARCHAR(255)      null comment '模板名称',
    task_name             VARCHAR(255)      null comment '任务名称',
    path                  VARCHAR(2000)     null comment '巡更轨迹',
    start_up              VARCHAR(20)       null comment '是否启动',
    dept_id               BIGINT(19)        null comment '辖区',
    remark                VARCHAR(2000)     null comment '描述',
    create_time           BIGINT(19)        null,
    update_time           BIGINT(19)        null,
    template_id           BIGINT(19)        null comment '模板ID',
    repeat_time           VARCHAR(255)      null comment '重复类型',
    sys_patrol_start_time VARCHAR(50)       null comment '系统巡更开始时间',
    sys_patrol_end_time   VARCHAR(50)       null comment '系统巡更结束时间',
    exec_time             BIGINT(19)        null comment '提前下发时间',
    active_date_start     VARCHAR(255)      null comment '生效日期',
    active_date_end       VARCHAR(255)      null comment '失效日期',
    is_del                INT(10) default 0 null
)
    charset = utf8mb4;

